gtd(){return"Im Kern sind wir eine engagierte Gruppe von leidenschaftlichen Rollenspiel-Enthusiasten, die ein gemeinsames Ziel teilen: die faszinierende Welt der Rollenspiele f\xfcr alle zug\xe4nglich zu machen. Wir glauben, dass die Magie des Geschichtenerz\xe4hlens und die fesselnden Abenteuer f\xfcr alle zug\xe4nglich sein sollten, die sich nach dem Nervenkitzel sehnen, epische Quests zu erstellen und zu unternehmen. Egal, ob Sie ein erfahrener Veteran oder ein kompletter Neuling sind, unsere Mission ist es, die Werkzeuge, Anleitung und Ressourcen bereitzustellen, um Ihnen zu helfen, in das fesselnde Reich der Rollenspiele einzutauchen. Wir sind hier, um Kreativit\xe4t zu f\xf6rdern, die Vorstellungskraft zu entfachen und eine einladende Gemeinschaft aufzubauen, in der die Wunder des Rollenspiels gefeiert werden."},
gte(){return"Unsere Reise wird von einer tief verwurzelten Liebe zum Geschichtenerz\xe4hlen, einem Engagement f\xfcr Inklusivit\xe4t und dem Wunsch, sich mit gleichgesinnten Menschen zu verbinden, die unsere Leidenschaft teilen, angetrieben. Mit reichlich Erfahrung und grenzenlosem Enthusiasmus bem\xfchen wir uns, Barrieren abzubauen, die Lernkurve zu vereinfachen und Sie zu ermutigen, Ihre eigenen einzigartigen Abenteuer zu unternehmen. Ob Sie ein Dungeon Master, ein Spieler oder einfach nur neugierig auf diese faszinierende Welt sind, schlie\xdfen Sie sich uns auf dieser epischen Quest an, w\xe4hrend wir bestrebt sind, Rollenspiele zu einem angenehmen und zug\xe4nglichen Erlebnis f\xfcr alle zu machen."},
