gvL(){return"Willkommen im Regelbereich! Hier erfahren Sie schnell, was Sie ben\xf6tigen, um loszulegen und Spa\xdf zu haben!\n\n"},
gvP(){return"Wie man spielt"},
gvQ(){return"Um mit dem Spielen zu beginnen, dr\xfccken Sie einfach die Schaltfl\xe4che 'Spiel starten' und w\xe4hlen Sie den Spielmodus aus (in dieser ersten Version ist nur der Einzelspielermodus verf\xfcgbar). Als N\xe4chstes k\xf6nnen Sie die Rolle ausw\xe4hlen, die Sie spielen m\xf6chten:\n\n"},
gvR(){return"Nachdem Sie Ihren Spielmodus ausgew\xe4hlt haben, k\xf6nnen Sie Ihr Spiel konfigurieren. Sie m\xfcssen eine kurze Beschreibung der Handlungsumgebung angeben, der Sie folgen m\xf6chten (einschlie\xdflich der Bedingung, das Spiel zu beenden), und Ihr Charakterblatt erstellen. Machen Sie sich keine Sorgen, wenn Sie damit keine Erfahrung haben; das Spiel kann ein Charakterblatt f\xfcr Sie generieren - es erledigt alles! (Derzeit generiert das Spiel nur automatisch erstellte Charakterbl\xe4tter.)\n\n"},
gvS(){return"Danach, wenn Sie gen\xfcgend Token haben, um zu spielen, k\xf6nnen Sie Ihre neue Kampagne starten!\n\n"},
gvT(){return"Dieser Teil ist wichtig. Da eine KI f\xfcr die Anleitung des Spiels verantwortlich ist und nicht ein Mensch, m\xfcssen sich alle Spieler verpflichten, bestimmte Richtlinien zu befolgen, um den Spielfluss zu erleichtern:\n\n"},
gvU(){return"Halten Sie sich an Ihr Charakterblatt: Erinnern Sie sich an die Details Ihres Charakters und integrieren Sie sie bei jeder Gelegenheit in das Gespr\xe4ch, um der KI mehr Kontext zu bieten. \xc4ndern Sie die Details Ihres Charakters nicht, es sei denn, Sie werden dazu aufgefordert.\n\n"},
gvV(){return"Erfinden Sie keine W\xfcrfelergebnisse: Der nat\xfcrliche Mechanismus f\xfcr Rollenspiele sind W\xfcrfelw\xfcrfe. Wenn Sie aufgefordert werden, einen Wurf zu machen, erfinden Sie keine Werte. Akzeptieren Sie die Zuf\xe4lligkeit!\n\n"},
gvW(){return"Halten Sie die KI im Kontext: Wir vertrauen darauf, dass Sie der Geschichte folgen, die von der KI bereitgestellt wird. Korrigieren Sie, wenn n\xf6tig, treffen Sie Entscheidungen, die Ihr Charakter treffen w\xfcrde, und schlagen Sie Ihren eigenen Weg ein, aber weichen Sie nicht in nicht zusammenh\xe4ngende Themen ab. Sie k\xf6nnten die KI verwirren und die Erz\xe4hlung st\xf6ren.\n\n"},
gvM(){return"Kein Schummeln: Wir appellieren an die Wohlgesonnenheit unserer Spieler. Wenn etwas schief geht, z\xf6gern Sie nicht, der KI zu helfen, sich an bestimmte Entscheidungen und Aspekte Ihres Charakterblatts zu erinnern.\n\n"},
gvN(){return"Verhalten Sie sich so, wie Sie es mit Ihrem vertrauensw\xfcrdigen Spielleiter tun w\xfcrden: Es ist die Verantwortung jedes Spielers, sicherzustellen, dass es ein unterhaltsames und leicht verst\xe4ndliches Spiel ist.\n\n"},
gvO(){return"Haftungsausschluss: Da es sich um eine externe Konversations-KI handelt, sind wir nicht verantwortlich f\xfcr den Inhalt der Gespr\xe4che. Wir vertrauen auf Sie!"},
