gpl(){return"Das Aliens Role Game spielt typischerweise in einem futuristischen, raumfahrenden Universum, in dem die Menschheit und verschiedene au\xdferirdische Spezies koexistieren. Spieler k\xf6nnen aus einer Vielzahl von Charakterrollen w\xe4hlen, von raumfahrenden Entdeckern bis hin zu au\xdferirdischen Diplomaten oder S\xf6ldnern.\n\n"},
gpw(){return"Das Spiel verwendet oft ein Regelwerk, das Geschichtenerz\xe4hlen, Charakterentwicklung und W\xfcrfelmechanik kombiniert. Spieler erstellen Charaktere mit einzigartigen Attributen und F\xe4higkeiten und interagieren mit der Spielwelt durch narrative Interaktionen und W\xfcrfelw\xfcrfe.\n\n"},
gpH(){return"Spieler erstellen typischerweise Charaktere, indem sie eine Spezies (menschlich oder au\xdferirdisch) ausw\xe4hlen und Attribute, F\xe4higkeiten und Hintergr\xfcnde zuweisen. Diese Entscheidungen definieren die F\xe4higkeiten eines Charakters und seine Rolle in der Spielwelt.\n\n"},
gpS(){return"F\xe4higkeiten sind die F\xe4higkeiten eines Charakters, die die Expertise oder Beherrschung in bestimmten Bereichen repr\xe4sentieren. So verwenden Sie sie effektiv:\n\n"},
gpY(){return"Talente sind einzigartige, charakterspezifische F\xe4higkeiten oder Eigenschaften, die verwendet werden k\xf6nnen, um im Spiel Vorteile zu erlangen.\n\n"},
gpZ(){return"Spezialisierte Kampftechniken, die Charakteren einzigartige Angriffe oder Verteidigungen gew\xe4hren.\n\n"},
gq_(){return"Au\xdfergew\xf6hnliche soziale Talente wie \xdcberredung, Einsch\xfcchterung oder Diplomatie.\n\n"},
gpm(){return"Technische Talente f\xfcr Hacking, Reparatur oder die Erstellung von Gadgets.\n\n"},
gpn(){return"Pers\xf6nliche Agenden verleihen der Charakterentwicklung und dem Rollenspiel Tiefe. Jeder Charakter kann eigene pers\xf6nliche Ziele, W\xfcnsche und Motivationen haben, die sich mit der \xfcbergeordneten Geschichte in Konflikt geraten oder in Einklang stehen k\xf6nnen.\n\n"},
gpo(){return"Ermutigen Sie die Spieler, pers\xf6nliche Agenden f\xfcr ihre Charaktere zu erstellen, die mit den Themen und der Erz\xe4hlung des Spiels in Einklang stehen.\n\n"},
gpp(){return"Sie k\xf6nnen Belohnungen, Story-Hooks oder M\xf6glichkeiten zur Charakterentwicklung im Zusammenhang mit dem Erreichen pers\xf6nlicher Agenden erhalten.\n\n"},
gpq(){return"Verwenden Sie pers\xf6nliche Agenden, um Charakterdilemmas, moralische Entscheidungen und Konflikte einzuf\xfchren, die das Erlebnis des Geschichtenerz\xe4hlens bereichern.\n\n"},
gpr(){return"In Aliens Role Game bieten die W\xfcrfelmechaniken eine M\xf6glichkeit, Unsicherheit und Zufall in das Spiel einzuf\xfchren und es den Spielern zu erm\xf6glichen, die Ergebnisse von Charakteraktionen, K\xe4mpfen und verschiedenen Herausforderungen zu bestimmen.\n\n"},
gps(){return"Entscheiden Sie \xfcber die Arten von W\xfcrfeln, die im Spiel verwendet werden sollen. Sie k\xf6nnen beispielsweise einen Standard-Sechsseiten-W\xfcrfel (D6) f\xfcr einfache F\xe4higkeitspr\xfcfungen, einen Zehnseiten-W\xfcrfel (D10) f\xfcr komplexere Aktionen und einen Zwanzigseiten-W\xfcrfel (D20) f\xfcr kritische oder bedeutende Ereignisse verwenden.\n\n"},
gpt(){return"Verkn\xfcpfen Sie Charakterf\xe4higkeiten, -f\xe4higkeiten und Attribute mit bestimmten W\xfcrfelw\xfcrfen. Ein Charakter mit hohen Verhandlungsf\xe4higkeiten w\xfcrfelt beispielsweise einen D10 und addiert sein Charisma-Attribut, um das Ergebnis einer diplomatischen Begegnung zu bestimmen.\n\n"},
gpu(){return"Definieren Sie Erfolgsschwellen f\xfcr W\xfcrfelw\xfcrfe. Spieler m\xfcssen in der Regel eine Zielzahl (eine 'Erfolgsschwelle') erreichen oder \xfcberschreiten, um in ihren Aktionen erfolgreich zu sein. Die Schwelle kann je nach Schwierigkeitsgrad der Aufgabe variieren.\n\n"},
gpv(){return"Erw\xe4gen Sie die Integration von Modifikatoren, die W\xfcrfelw\xfcrfe beeinflussen k\xf6nnen. Diese Modifikatoren k\xf6nnen aus den F\xe4higkeiten eines Charakters, Ausr\xfcstung, Umweltfaktoren oder anderen Umst\xe4nden im Spiel stammen.\n\n"},
gpx(){return"Schlie\xdfen Sie Mechanismen f\xfcr kritische Erfolge und kritische Misserfolge ein. Beispielsweise kann das W\xfcrfeln der h\xf6chstm\xf6glichen Zahl auf dem W\xfcrfel zu einem au\xdfergew\xf6hnlichen Erfolg f\xfchren, w\xe4hrend das W\xfcrfeln der niedrigsten Zahl zu einem katastrophalen Misserfolg f\xfchren k\xf6nnte.\n\n"},
gpy(){return"Implementieren Sie das Konzept von W\xfcrfelpools, bei dem Charaktere basierend auf ihren F\xe4higkeiten oder Vorteilen mehrere W\xfcrfel ansammeln und werfen. Die Summe der W\xfcrfel im Pool bestimmt das Ergebnis.\n\n"},
gpz(){return"Ein Spielleiter (SL) f\xfchrt die Geschichte und fungiert als Geschichtenerz\xe4hler. Er kontrolliert die Nicht-Spieler-Charaktere (NSC), Umgebungen und Herausforderungen, mit denen die Spielercharaktere konfrontiert sind. Der Spielleiter hilft dabei, die Erz\xe4hlung zu formen und sich an Spielerentscheidungen anzupassen.\n\n"},
gpA(){return"Spieler sto\xdfen h\xe4ufig auf eine Vielzahl von au\xdferirdischen Spezies, jede mit einzigartigen Merkmalen, F\xe4higkeiten und Kulturen. Diplomatie, Verhandlung und Kampf k\xf6nnen alle eine Rolle spielen, wenn es darum geht, mit diesen au\xdferirdischen Wesen umzugehen.\n\n"},
gpB(){return"Das Spiel f\xf6rdert die Erkundung verschiedener au\xdferirdischer Welten, Raumstationen und kosmischer Ph\xe4nomene. Diese Erkundung f\xfchrt oft zur Entdeckung von Geheimnissen, Herausforderungen und neuen Verb\xfcndeten.\n\n"},
gpC(){return"Kampf kann ein integraler Bestandteil des Spiels sein, bei dem sich Charaktere mit au\xdferirdischen Bedrohungen, Piraten oder sogar anderen Fraktionen im Spieluniversum auseinandersetzen. Verwenden Sie Ihre Ausr\xfcstung, um Ihre Feinde zu besiegen ... und versuchen Sie nicht zu oft in Panik zu geraten, sonst verlieren Sie Ihren Verstand. Das System sollte Spannung erzeugen, schnelle Handlungen simulieren und strategische Entscheidungen erm\xf6glichen.\n\n"},
gpD(){return"Bestimmen Sie die Reihenfolge der Aktionen im Kampf mit einem Initiative-System. Dies kann auf der Geschwindigkeit der Charaktere, ihren F\xe4higkeiten oder einem einfachen W\xfcrfelwurf basieren.\n\n"},
gpE(){return"Im Kampf hat jeder Charakter eine Runde, in der er eine festgelegte Anzahl von Aktionen ausf\xfchren kann. Typische Aktionen sind Angriffe, Bewegungen, die Verwendung von Gegenst\xe4nden oder das Deckung suchen.\n\n"},
gpF(){return"Wenn ein Charakter versucht anzugreifen, f\xfchrt er einen Angriffswurf mit dem bestimmten Kampfw\xfcrfel durch (z. B. D20). Das Ergebnis des Wurfs, zusammen mit Modifikatoren, bestimmt, ob der Angriff das Ziel trifft.\n\n"},
gpG(){return"Bestimmen Sie die Menge des durch erfolgreiche Angriffe zugef\xfcgten Schadens. Unterschiedliche Waffen oder F\xe4higkeiten k\xf6nnen unterschiedliche Schadenswerte haben. Charaktere haben eine festgelegte Menge an Gesundheit (Trefferpunkte), und durch Schaden wird ihre Gesundheit reduziert.\n\n"},
gpI(){return"Charaktere k\xf6nnen eine R\xfcstung oder defensive F\xe4higkeiten haben, die den erlittenen Schaden reduzieren. Dies f\xfcgt dem Kampf Strategie hinzu, da die Spieler entscheiden m\xfcssen, ob sie defensive oder offensive Aktionen priorisieren sollen.\n\n"},
gpJ(){return"Integrieren Sie Mechanismen f\xfcr kritische Treffer, bei denen ein bestimmtes Ergebnis (z. B. das W\xfcrfeln einer nat\xfcrlichen 20) zu einem kritischen Treffer f\xfchrt, der zus\xe4tzlichen Schaden verursacht. Erlauben Sie charakterspezifische Spezialf\xe4higkeiten, die im Kampf f\xfcr einzigartige Effekte verwendet werden k\xf6nnen.\n\n"},
gpK(){return"F\xfchren Sie Statuswirkungen ein, wie Vergiftung, Bluten oder Bet\xe4ubung, die Charaktere im Kampf beeinflussen k\xf6nnen. Statuswirkungen k\xf6nnen den Schlachten Komplexit\xe4t verleihen.\n\n"},
gpL(){return"Ber\xfccksichtigen Sie die Bewegung und Positionierung von Charakteren auf dem Schlachtfeld. Beachten Sie Faktoren wie Deckung, Sichtlinie und Reichweite von Fernk\xe4mpfen.\n\n"},
