gqK(){return"Dungeons & Dragons: Eine Reise in die Vorstellungskraft"},
gqV(){return"Willkommen bei Dungeons & Dragons (D&D), einem Spiel, das die Grenzen des Tabletop-Spielens \xfcberwindet und zu einem immersiven Abenteuer in die Bereiche Kreativit\xe4t, Strategie und Geschichtenerz\xe4hlen wird. Im Kern ist D&D mehr als nur ein Spiel; es ist eine geteilte Erfahrung, bei der die Spieler zu den Helden ihrer eigenen epischen Geschichten werden.\n\n"},
gr5(){return"Die Essenz von D&D: Ein gemeinsames Abenteuer"},
gre(){return"D&D ist nicht nur ein Spiel; es ist eine gemeinschaftliche Geschichtenerz\xe4hlung, bei der die Spieler die Rollen einzigartiger Charaktere in einer Fantasy-Welt \xfcbernehmen. Gef\xfchrt von einem Dungeon Master (DM) entfaltet sich die Handlung durch eine Reihe von Quests, Herausforderungen und unerwarteten Wendungen. Die Essenz liegt in der Freiheit, die Geschichte gemeinsam zu gestalten und Erinnerungen zu schaffen, die lange nach dem W\xfcrfeln haften bleiben.\n\n"},
grf(){return"Wie man spielt: Eine Symphonie aus W\xfcrfeln und Entscheidungen"},
grg(){return"Erschaffe deinen heldenhaften Charakter"},
grh(){return"W\xe4hle Rasse, Klasse und Hintergrund f\xfcr deinen Charakter. Wirst du ein elfischer Zauberer mit geheimnisvoller Vergangenheit oder ein zwergischer Krieger, der geschworen hat, seine Verb\xfcndeten zu verteidigen?\n\n"},
gri(){return"Bestimme die F\xe4higkeiten, St\xe4rken und Schw\xe4chen deines Charakters durch den Wurf der W\xfcrfel.\n\n"},
grj(){return"Begib dich auf Abenteuer"},
gqL(){return"Kooperiere mit deinen Mitabenteurern und starte Quests, die vom Dungeon Master pr\xe4sentiert werden.\n\n"},
gqM(){return"Navigiere durch Verliese, stelle dich mythischen Kreaturen und entdecke die Geheimnisse der Fantasy-Welt.\n\n"},
gqN(){return"Rollenspiel"},
gqO(){return"Tauche in die Pers\xf6nlichkeit deines Charakters ein. Sprich, denke und handle so, wie es dein Held in der gegebenen Situation tun w\xfcrde.\n\n"},
gqP(){return"Beteilige dich an Interaktionen mit Nicht-Spieler-Charakteren, triff Entscheidungen, die den Verlauf der Handlung beeinflussen.\n\n"},
gqQ(){return"W\xfcrfle die W\xfcrfel"},
gqR(){return"Das Spiel basiert auf einem Satz von Polyeder-W\xfcrfeln, um die Ergebnisse von Aktionen zu bestimmen. Der ikonische 20-seitige W\xfcrfel (d20) entscheidet oft \xfcber Erfolg oder Misserfolg deiner Bem\xfchungen.\n\n"},
gqS(){return"Kritische Treffer, Rettungsw\xfcrfe und F\xe4higkeitspr\xfcfungen f\xfcgen dem Spiel eine Element der Chance hinzu.\n\n"},
gqT(){return"Die Kunst des Dungeon Masters"},
gqU(){return"Der Dungeon Master fungiert als Geschichtenerz\xe4hler, Erz\xe4hler und Schiedsrichter. Sie f\xfchren die Spieler durch die Welt, pr\xe4sentieren Herausforderungen und reagieren auf Spielerentscheidungen.\n\n"},
gqW(){return"Ein erfolgreicher DM webt eine dynamische Erz\xe4hlung, passt sich an Spielerentscheidungen und Unvorhersehbarkeiten an.\n\n"},
gqX(){return"Erschaffen deines Charakters: Entfessle deinen inneren Helden"},
gqY(){return"Rasse"},
gqZ(){return"W\xe4hle eine Rasse f\xfcr deinen Charakter, jede mit einzigartigen F\xe4higkeiten und Merkmalen. Die Optionen reichen von Menschen und Elfen bis zu Zwergen, Halblingen und mehr.\n\n"},
gr_(){return"Klasse"},
gr0(){return"W\xe4hle eine Klasse, die die Berufsrichtung und F\xe4higkeiten deines Charakters definiert. Wirst du ein m\xe4chtiger Zauberer, ein listiger Schurke oder ein widerstandsf\xe4higer Kleriker sein?\n\n"},
gr1(){return"Hintergrund"},
gr2(){return"Bestimme den Hintergrund deines Charakters, der ihre F\xe4higkeiten, Pers\xf6nlichkeitsmerkmale und Verbindungen zur Welt pr\xe4gt. Hintergr\xfcnde umfassen Adepten, Gesetzlose, Gelehrte und mehr.\n\n"},
gr3(){return"F\xe4higkeitspunkte"},
gr4(){return"Generiere oder weise F\xe4higkeitspunkte (St\xe4rke, Geschicklichkeit, Konstitution, Intelligenz, Weisheit, Charisma) zu, die die F\xe4higkeiten deines Charakters beeinflussen.\n\n"},
gr6(){return"Ausr\xfcstung"},
gr7(){return"R\xfcste deinen Charakter mit Startausr\xfcstung basierend auf ihrer Klasse und ihrem Hintergrund aus. Zus\xe4tzliche Ausr\xfcstung kann durch In-Game-Erkundung und Quests erhalten werden.\n\n"},
gr8(){return"Vorgeschichte"},
gr9(){return"Entwickle eine reiche Vorgeschichte f\xfcr deinen Charakter. Erforsche ihre Urspr\xfcnge, Motivationen und pers\xf6nlichen Ziele, um eine narrative Grundlage f\xfcr das Rollenspiel zu schaffen.\n\n"},
gra(){return"Ausrichtung"},
grb(){return"W\xe4hle eine Ausrichtung, die den moralischen und ethischen Kompass deines Charakters widerspiegelt. Ausrichtungen reichen von rechtschaffen gut bis chaotisch b\xf6se.\n\n"},
grd(){return"D&D ist eine offene Leinwand, auf der die einzige Grenze deine Vorstellungskraft ist. Also, versammle deine Freunde, mache deine W\xfcrfel bereit und st\xfcrze dich in eine Reise, bei der jede Entscheidung, jeder Wurf und jeder geteilte Moment zu einem Teil deines einzigartigen Abenteuers in den Reichen von Dungeons & Dragons wird. M\xf6gen deine Quests k\xfchn sein, deine W\xfcrfe gl\xfccklich und deine Geschichten legend\xe4r!\n\n"},
