gpH(){return"Players typically create characters by selecting a species (human or alien) and assigning attributes, skills, and backgrounds. These choices define a character's abilities and role in the game world.\n\n"},
gpS(){return"Skills are character abilities that represent a character's expertise or proficiency in specific areas. Here's how to use them effectively:\n\n"},
gpY(){return"Talents are unique, character-specific abilities or traits that can be used to gain advantages in the game.\n\n"},
gpZ(){return"Specialized combat techniques, granting characters unique attacks or defenses.\n\n"},
gq_(){return"Exceptional social talents like persuasion, intimidation, or diplomacy.\n\n"},
gpm(){return"Technical talents for hacking, repair, or gadget creation.\n\n"},
gpn(){return"Personal agendas add depth to character development and role-playing. Each character can have their own personal goals, desires, and motivations that may conflict or align with the overarching story.\n\n"},
gpo(){return"Encourage players to create personal agendas for their characters that align with the game's themes and narrative.\n\n"},
gpp(){return"You may receive rewards, story hooks, or character development opportunities related to achieving personal agendas.\n\n"},
gpq(){return"Use personal agendas to introduce character dilemmas, moral choices, and conflicts that enrich the storytelling experience.\n\n"},
gpr(){return"In Aliens Role Game, the dice mechanics provide a way to introduce uncertainty and randomness into the game, allowing players to determine the outcomes of character actions, combat, and various challenges.\n\n"},
gps(){return"Decide on the types of dice to be used in the game. For example, you can use a standard six-sided die (D6) for simple skill checks, a ten-sided die (D10) for more complex actions, and a twenty-sided die (D20) for critical or significant events.\n\n"},
gpt(){return"Link character abilities, skills, and attributes to specific dice rolls. For example, a character with high negotiation skills might roll a D10 and add their charisma attribute to determine the outcome of a diplomatic encounter.\n\n"},
gpu(){return"Define success thresholds for dice rolls. Players typically need to meet or exceed a target number (a 'success threshold') to succeed in their actions. The threshold can vary depending on the difficulty of the task.\n\n"},
gpv(){return"Consider incorporating modifiers that can influence dice rolls. These modifiers can come from a character's skills, equipment, environmental factors, or other in-game circumstances.\n\n"},
gpx(){return"Include mechanics for critical successes and critical failures. For instance, rolling the highest possible number on the die might result in an extraordinary success, while rolling the lowest could lead to a catastrophic failure.\n\n"},
gpy(){return"Implement the concept of dice pools, where characters accumulate and roll multiple dice based on their abilities or advantages. The sum of the dice in the pool determines the result.\n\n"},
gpz(){return"A Game Master (GM) guides the story and serves as the storyteller, controlling the non-player characters (NPCs), environments, and challenges that the player characters face. The GM helps to shape the narrative and adapt to player choices.\n\n"},
gpA(){return"Players frequently encounter a wide variety of alien species, each with unique characteristics, abilities, and cultures. Diplomacy, negotiation, and combat can all come into play when dealing with these extraterrestrial beings.\n\n"},
gpB(){return"The game encourages exploration of diverse alien worlds, space stations, and cosmic phenomena. This exploration often leads to the discovery of secrets, challenges, and new allies.\n\n"},
gpC(){return"Combat may be an integral part of the game, with characters facing off against alien threats, pirates, or even other factions within the game universe. Use your equipment to defeat your enemies\u2026.and try not to panic too often, or you\u2019ll lose your sanity. The system should create tension, simulate fast-paced action, and allow for strategic decision-making.\n\n"},
gpD(){return"Determine the order of actions in combat by using an initiative system. This can be based on characters' speed, skills, or a simple roll of the dice.\n\n"},
gpE(){return"In combat, each character takes a turn during which they can perform a set number of actions. Typical actions include attacking, moving, using items, or taking cover.\n\n"},
gpF(){return"When a character attempts to attack, they make an attack roll using the designated combat dice (e.g., D20). The roll's outcome, along with modifiers, determines if the attack hits the target.\n\n"},
gpG(){return"Determine the amount of damage dealt by successful attacks. Different weapons or abilities may have varying damage values. Characters have a set amount of health (hit points), and taking damage reduces their health.\n\n"},
gpI(){return"Characters may have armor or defensive abilities that reduce the damage taken. This adds strategy to combat as players must decide whether to prioritize defensive or offensive actions.\n\n"},
gpJ(){return"Incorporate critical hit mechanics where a specific result (e.g., rolling a natural 20) leads to a critical hit, inflicting extra damage. Allow for character-specific special abilities that can be used in combat for unique effects.\n\n"},
gpK(){return"Introduce status effects, such as poison, bleeding, or stunned, which can affect characters during combat. Status effects can add complexity to battles.\n\n"},
gpL(){return"Take into account character movement and positioning on the battlefield. Consider factors like cover, line of sight, and ranged combat ranges.\n\n"},
gpM(){return"Characters may have a morale or bravery score that affects their combat performance. When characters witness disturbing events or are injured, their morale may drop, potentially causing them to flee or panic.\n\n"},
gpN(){return"Panic mechanics add a psychological dimension to the Aliens Role Game, reflecting the stress and fear experienced by characters in intense or terrifying situations. Here's how panic can be integrated into the game\n\n"},
gpO(){return"Assign a panic threshold for each character. This threshold represents how much stress or fear a character can withstand before panicking. It can be influenced by character attributes and backgrounds.\n\n"},
gpP(){return"Specify events or conditions that can trigger panic. These may include witnessing a horrific alien creature, being severely injured, or facing overwhelming odds in combat.\n\n"},
gpQ(){return"When a character's panic threshold is exceeded, they might suffer from panic effects. These effects could include:\n\n"},
gpR(){return"Reduced accuracy in combat.\n\n"},
gpT(){return"Impaired decision-making, causing characters to make irrational choices.\n\n"},
gpU(){return"A heightened likelihood of fleeing from danger.\n\n"},
gpV(){return"Increased vulnerability to status effects like fear or confusion.\n\n"},
gpW(){return"Characters may have a chance to recover from panic over time, with support from other characters, or by taking specific actions to calm themselves.\n\n"},
gpX(){return"Feel encouraged to role-play your character\u2019s fear and stress during panic situations. This adds depth to the narrative and immerses players in the game's atmosphere.\n\n"},
