gqK(){return"Dungeons & Dragons: Un Viaje a la Imaginaci\xf3n"},
gqV(){return"Bienvenido a Dungeons & Dragons (D&D), un juego que trasciende las fronteras del juego de mesa para convertirse en una aventura inmersiva en los reinos de la creatividad, estrategia y narraci\xf3n. En su n\xfacleo, D&D es m\xe1s que un juego; es una experiencia compartida donde los jugadores se convierten en los h\xe9roes de sus propios cuentos \xe9picos.\n\n"},
gr5(){return"La Esencia de D&D: Una Aventura Colaborativa"},
gre(){return"D&D no es solo un juego; es una experiencia de contar historias colaborativa donde los jugadores asumen los roles de personajes \xfanicos dentro de un mundo de fantas\xeda. Guiados por un Dungeon Master (DM), la narrativa se desarrolla a trav\xe9s de una serie de misiones, desaf\xedos e giros inesperados. La esencia radica en la libertad para dar forma a la historia juntos, creando recuerdos que perduran mucho despu\xe9s de que los dados hayan sido lanzados.\n\n"},
grf(){return"C\xf3mo Jugar: Una Sinfon\xeda de Dados y Toma de Decisiones"},
grg(){return"Crea tu Personaje Heroico"},
grh(){return"Elige una raza, clase y trasfondo para tu personaje. \xbfSer\xe1s un mago \xe9lfico con un pasado misterioso o un guerrero enano jurado a defender a tus aliados?\n\n"},
gri(){return"Determina las habilidades, fortalezas y debilidades de tu personaje a trav\xe9s del lanzamiento de los dados.\n\n"},
grj(){return"Embarcate en Aventuras"},
gqL(){return"Colabora con tus compa\xf1eros aventureros y emprende misiones presentadas por el Dungeon Master.\n\n"},
gqM(){return"Navega por mazmorras, enfrenta criaturas m\xedticas y descubre los secretos del mundo de fantas\xeda.\n\n"},
gqN(){return"Rol en el Juego"},
gqO(){return"Sum\xe9rgete en la personalidad de tu personaje. Habla, piensa y act\xfaa como lo har\xeda tu h\xe9roe en la situaci\xf3n dada.\n\n"},
gqP(){return"Participa en interacciones con personajes no jugadores, tomando decisiones que impactan la narrativa en desarrollo.\n\n"},
gqQ(){return"Lanza los Dados"},
gqR(){return"El juego se basa en un conjunto de dados poli\xe9dricos para determinar los resultados de las acciones. El ic\xf3nico dado de 20 caras (d20) a menudo decide el \xe9xito o fracaso de tus esfuerzos.\n\n"},
gqS(){return"Golpes cr\xedticos, tiros de salvaci\xf3n y comprobaciones de habilidades agregan un elemento de azar al juego.\n\n"},
gqT(){return"El Arte del Dungeon Master"},
gqU(){return"El Dungeon Master sirve como el narrador, cuentacuentos y \xe1rbitro. Gu\xedan a los jugadores a trav\xe9s del mundo, presentando desaf\xedos y reaccionando a las elecciones de los jugadores.\n\n"},
gqW(){return"Un DM exitoso teje una narrativa din\xe1mica, adapt\xe1ndose a las decisiones de los jugadores e imprevisibilidad.\n\n"},
gqX(){return"Creando tu Personaje: Desatando tu H\xe9roe Interior"},
gqY(){return"Raza"},
gqZ(){return"Elige una raza para tu personaje, cada una con habilidades y rasgos \xfanicos. Las opciones van desde humanos y elfos hasta enanos, medianos y m\xe1s.\n\n"},
gr_(){return"Clase"},
gr0(){return"Selecciona una clase que define la profesi\xf3n y habilidades de tu personaje. \xbfSer\xe1s un poderoso mago, un astuto p\xedcaro o un resistente cl\xe9rigo?\n\n"},
gr1(){return"Trasfondo"},
gr2(){return"Determina el trasfondo de tu personaje, dando forma a sus habilidades, rasgos de personalidad y conexiones con el mundo. Los trasfondos incluyen ac\xf3litos, forajidos, eruditos y m\xe1s.\n\n"},
gr3(){return"Puntuaciones de Habilidades"},
