gr6(){return"Equipo"},
gr7(){return"Equipa a tu personaje con equipo inicial basado en su clase y trasfondo. Equipo adicional se puede obtener a trav\xe9s de la exploraci\xf3n y misiones en el juego.\n\n"},
gr8(){return"Historia Anterior"},
