grb(){return"Elige una alineaci\xf3n que refleje la br\xfajula moral y \xe9tica de tu personaje. Las alineaciones van desde legal bueno hasta ca\xf3tico malvado.\n\n"},
grd(){return"D&D es un lienzo abierto donde el \xfanico l\xedmite es tu imaginaci\xf3n. As\xed que re\xfane a tus amigos, prepara tus dados y embarca en un viaje donde cada elecci\xf3n, cada lanzamiento y cada momento compartido se convierte en parte de tu aventura \xfanica en los reinos de Dungeons & Dragons. \xa1Que tus misiones sean audaces, tus lanzamientos afortunados y tus historias legendarias!\n\n"},
