gq6(){return"Llamada de Cthulhu: Un Descenso al Horror C\xf3smico"},
gqh(){return"Bienvenido a Llamada de Cthulhu, un juego de rol que te sumerge en los inquietantes reinos del horror c\xf3smico inspirado en las obras de H.P. Lovecraft. Este juego no se trata solo de sobrevivir; se trata de mantener la cordura mientras te enfrentas a entidades antiguas y mal\xe9volas que desaf\xedan la comprensi\xf3n humana. Prep\xe1rate para embarcarte en un viaje donde los misterios son oscuros y los horrores van m\xe1s all\xe1 de la comprensi\xf3n.\n\n"},
gqs(){return"La Esencia de Llamada de Cthulhu: Abrazar lo Desconocido"},
gqB(){return"Llamada de Cthulhu prepara el escenario para una narrativa empapada de misterio, temor y lo desconocido. Como investigadores, los jugadores desentra\xf1an conspiraciones, enfrentan horrores arcanos y luchan con la fragilidad de su propia cordura. Es un juego donde la supervivencia puede significar escapar con la mente intacta en lugar de salir ileso.\n\n"},
gqC(){return"C\xf3mo Jugar: Una Danza con la Locura"},
gqD(){return"Crea tu Investigador"},
gqE(){return"Construye un investigador, un personaje lanzado a los reinos del horror c\xf3smico. Selecciona una profesi\xf3n, antecedentes y conexiones personales que te definan.\n\n"},
gqF(){return"Las habilidades y caracter\xedsticas del investigador desempe\xf1an un papel crucial en determinar la capacidad de tu personaje para navegar por los misterios.\n\n"},
gqG(){return"Explora lo Desconocido"},
gq7(){return"Sum\xe9rgete en investigaciones que te llevan a tomos prohibidos, artefactos antiguos y ubicaciones cr\xedpticas.\n\n"},
gq8(){return"Descubre pistas, descifra mensajes cr\xedpticos y conecta los puntos para revelar la verdad espeluznante.\n\n"},
gq9(){return"Enfrenta Horrores C\xf3smicos"},
gqa(){return"Enfrenta entidades sobrenaturales que desaf\xedan la comprensi\xf3n humana. Estos horrores pueden distorsionar la realidad, poniendo a prueba los l\xedmites de la cordura de tu investigador.\n\n"},
gqb(){return"La soluci\xf3n no siempre es el combate. A veces, huir o esconderse es la \xfanica forma de sobrevivir.\n\n"},
gqc(){return"Mec\xe1nica de Cordura"},
gqd(){return"La cordura de tu investigador es tan importante como su bienestar f\xedsico. Presenciar horrores inefables o adentrarse demasiado en el conocimiento prohibido puede erosionar tu cordura.\n\n"},
gqe(){return"A medida que la cordura disminuye, los personajes pueden desarrollar fobias, alucinaciones o incluso caer en la locura.\n\n"},
gqf(){return"El Mito"},
gqg(){return"El juego est\xe1 impregnado de la mitolog\xeda lovecraftiana, con entidades c\xf3smicas como Cthulhu, Nyarlathotep y Azathoth. Estos seres existen m\xe1s all\xe1 de la comprensi\xf3n humana y a menudo impulsan la narrativa general.\n\n"},
gqi(){return"Creando tu Investigador: Desentra\xf1ando la Psique Humana"},
gqj(){return"Profesi\xf3n y Antecedentes"},
gqk(){return"Elige una profesi\xf3n para tu investigador, ya sea bibliotecario, periodista, detective o acad\xe9mico. Tu elecci\xf3n impacta en tus habilidades iniciales y conexiones.\n\n"},
gql(){return"Selecciona un trasfondo que d\xe9 profundidad a tu personaje, proporcionando motivaci\xf3n e historia personal.\n\n"},
gqm(){return"Habilidades y Caracter\xedsticas"},
gqn(){return"Las habilidades del investigador abarcan una variedad de habilidades, desde el uso de bibliotecas y detectar lo oculto hasta el uso de armas de fuego y el conocimiento oculto.\n\n"},
gqo(){return"Caracter\xedsticas como fuerza, destreza, inteligencia y apariencia determinan las capacidades b\xe1sicas de tu investigador.\n\n"},
gqp(){return"Conexi\xf3n Personal"},
gqq(){return"Define relaciones con otros investigadores. Estas conexiones pueden proporcionar apoyo, recursos o incluso llevar a tramas tr\xe1gicas.\n\n"},
gqr(){return"Equipo"},
