gq6(){return"L'Appel de Cthulhu : Une Descente dans l'Horreur Cosmique"},
gqh(){return"Bienvenue dans L'Appel de Cthulhu, un jeu de r\xf4le qui vous plonge dans les royaumes inqui\xe9tants de l'horreur cosmique inspir\xe9s des \u0153uvres de H.P. Lovecraft. Ce jeu ne concerne pas seulement la survie ; il s'agit de pr\xe9server sa sant\xe9 mentale tout en affrontant d'anciennes entit\xe9s malfaisantes qui d\xe9fient la compr\xe9hension humaine. Pr\xe9parez-vous \xe0 entreprendre un voyage o\xf9 les myst\xe8res sont sombres et les horreurs vont au-del\xe0 de la compr\xe9hension.\n\n"},
