gqK(){return"Dungeons & Dragons: Un Viaggio nell'Immaginazione"},
gqV(){return"Benvenuti in Dungeons & Dragons (D&D), un gioco che supera i confini del gioco da tavolo per diventare un'avventura immersiva nei regni della creativit\xe0, strategia e narrazione. Al suo nucleo, D&D \xe8 pi\xf9 di un gioco; \xe8 un'esperienza condivisa in cui i giocatori diventano gli eroi delle proprie epiche storie.\n\n"},
gr5(){return"L'Essenza di D&D: Un'Avventura Collaborativa"},
gre(){return"D&D non \xe8 solo un gioco; \xe8 un'esperienza collaborativa di narrazione in cui i giocatori assumono i ruoli di personaggi unici all'interno di un mondo fantasy. Guidata da un Dungeon Master (DM), la narrazione si sviluppa attraverso una serie di missioni, sfide e colpi di scena inaspettati. L'essenza sta nella libert\xe0 di plasmare la storia insieme, creando ricordi che persistono a lungo dopo che i dadi sono stati lanciati.\n\n"},
