gml(){return"Sobre N\xf3s"},
gtd(){return"Em ess\xeancia, somos um grupo dedicado de entusiastas apaixonados por RPG que compartilham um objetivo comum: tornar o encantador mundo dos jogos de interpreta\xe7\xe3o de personagens acess\xedvel a todos. Acreditamos que a magia da narrativa e das aventuras imersivas deve estar ao alcance de todos que anseiam pela emo\xe7\xe3o de criar e embarcar em jornadas \xe9picas. Se voc\xea \xe9 um veterano experiente ou um novato completo, nossa miss\xe3o \xe9 fornecer as ferramentas, orienta\xe7\xf5es e recursos para ajud\xe1-lo a mergulhar no cativante mundo dos jogos de interpreta\xe7\xe3o de personagens. Estamos aqui para incentivar a criatividade, despertar imagina\xe7\xf5es e construir uma comunidade acolhedora onde as maravilhas do RPG s\xe3o celebradas."},
