gvQ(){return"Para come\xe7ar a jogar, basta pressionar o bot\xe3o 'Iniciar Jogo' e selecionar o modo de jogo (neste primeira vers\xe3o, apenas o modo de jogador \xfanico est\xe1 dispon\xedvel). Em seguida, voc\xea pode escolher o papel que deseja desempenhar:\n\n"},
