gvT(){return"Essa parte \xe9 importante. Como \xe9 uma IA respons\xe1vel por guiar o jogo, e n\xe3o um humano, todos os jogadores devem se comprometer a seguir certas diretrizes para facilitar o andamento do jogo:\n\n"},
