gvV(){return"N\xe3o invente rolagens de dados: O mecanismo natural para jogos de interpreta\xe7\xe3o de personagens s\xe3o as rolagens de dados. Se for solicitado a fazer uma rolagem, n\xe3o invente os valores. Aceite o acaso!\n\n"},
gvW(){return"Mantenha a IA no contexto: Confiamos em voc\xea para seguir a hist\xf3ria fornecida pela IA. Afinal, ela n\xe3o \xe9 humana. Corrija quando necess\xe1rio, tome decis\xf5es que seu personagem tomaria e trace seu pr\xf3prio caminho, mas n\xe3o se desvie para t\xf3picos n\xe3o relacionados. Voc\xea pode confundir a IA e interromper a narrativa.\n\n"},
gvM(){return"Sem trapa\xe7a: Apelamos \xe0 boa vontade dos nossos jogadores. Se as coisas sa\xedrem do controle, n\xe3o hesite em ajudar a IA a lembrar certas decis\xf5es e aspectos da ficha do seu personagem.\n\n"},
