gqK(){return"Dungeons & Dragons: \u041f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0432 \u041c\u0438\u0440 \u0412\u043e\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u044f"},
gqV(){return"\u0414\u043e\u0431\u0440\u043e \u043f\u043e\u0436\u0430\u043b\u043e\u0432\u0430\u0442\u044c \u0432 Dungeons & Dragons (D&D), \u0438\u0433\u0440\u0443, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043f\u0440\u0435\u043e\u0434\u043e\u043b\u0435\u0432\u0430\u0435\u0442 \u0433\u0440\u0430\u043d\u0438\u0446\u044b \u043d\u0430\u0441\u0442\u043e\u043b\u044c\u043d\u044b\u0445 \u0438\u0433\u0440, \u043f\u0440\u0435\u0432\u0440\u0430\u0449\u0430\u044f\u0441\u044c \u0432 \u0437\u0430\u0445\u0432\u0430\u0442\u044b\u0432\u0430\u044e\u0449\u0435\u0435 \u043f\u0440\u0438\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u0432 \u043c\u0438\u0440\u0435 \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0430, \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438 \u0438 \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u043e\u0432. \u0412 \u0441\u0432\u043e\u0435\u0439 \u0441\u0443\u0442\u0438 D&D - \u044d\u0442\u043e \u043d\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u0438\u0433\u0440\u0430; \u044d\u0442\u043e \u043e\u0431\u0449\u0438\u0439 \u043e\u043f\u044b\u0442, \u0433\u0434\u0435 \u0438\u0433\u0440\u043e\u043a\u0438 \u0441\u0442\u0430\u043d\u043e\u0432\u044f\u0442\u0441\u044f \u0433\u0435\u0440\u043e\u044f\u043c\u0438 \u0441\u0432\u043e\u0438\u0445 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u044d\u043f\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0441\u043a\u0430\u0437\u0430\u043d\u0438\u0439.\n\n"},
