gqh(){return"\u0414\u043e\u0431\u0440\u043e \u043f\u043e\u0436\u0430\u043b\u043e\u0432\u0430\u0442\u044c \u0432 \u0417\u043e\u0432 \u041a\u0442\u0443\u043b\u0445\u0443, \u0440\u043e\u043b\u0435\u0432\u0443\u044e \u0438\u0433\u0440\u0443, \u043f\u043e\u0433\u0440\u0443\u0436\u0430\u044e\u0449\u0443\u044e \u0432\u0430\u0441 \u0432 \u0442\u0440\u0435\u0432\u043e\u0436\u043d\u044b\u0435 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0443\u0436\u0430\u0441\u0430, \u0432\u0434\u043e\u0445\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f\u043c\u0438 \u0413.\u0424. \u041b\u0430\u0432\u043a\u0440\u0430\u0444\u0442\u0430. \u042d\u0442\u0430 \u0438\u0433\u0440\u0430 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u043e \u0432\u044b\u0436\u0438\u0432\u0430\u043d\u0438\u0438; \u043e\u043d\u0430 \u043e \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0438 \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u0430, \u043a\u043e\u0433\u0434\u0430 \u0432\u044b \u0441\u0442\u0430\u043b\u043a\u0438\u0432\u0430\u0435\u0442\u0435\u0441\u044c \u0441 \u0434\u0440\u0435\u0432\u043d\u0438\u043c\u0438, \u0437\u043b\u043e\u0432\u0435\u0449\u0438\u043c\u0438 \u0441\u0443\u0449\u043d\u043e\u0441\u0442\u044f\u043c\u0438, \u0432\u044b\u0445\u043e\u0434\u044f\u0449\u0438\u043c\u0438 \u0437\u0430 \u0440\u0430\u043c\u043a\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u044f. \u0413\u043e\u0442\u043e\u0432\u044c\u0442\u0435\u0441\u044c \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u0442\u044c\u0441\u044f \u0432 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435, \u0433\u0434\u0435 \u0442\u0430\u0439\u043d\u044b \u043c\u0440\u0430\u043a\u0430, \u0430 \u0443\u0436\u0430\u0441\u044b \u0432\u044b\u0445\u043e\u0434\u044f\u0442 \u0437\u0430 \u043f\u0440\u0435\u0434\u0435\u043b\u044b \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u044f.\n\n"},
