gqB(){return"\u0417\u043e\u0432 \u041a\u0442\u0443\u043b\u0445\u0443 \u0441\u043e\u0437\u0434\u0430\u0435\u0442 \u043e\u0441\u043d\u043e\u0432\u0443 \u0434\u043b\u044f \u043f\u043e\u0432\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f, \u043f\u0440\u043e\u043f\u0438\u0442\u0430\u043d\u043d\u043e\u0433\u043e \u0442\u0430\u0439\u043d\u043e\u0439, \u0441\u0442\u0440\u0430\u0445\u043e\u043c \u0438 \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0441\u0442\u044c\u044e. \u0418\u0433\u0440\u043e\u043a\u0438, \u0432 \u0440\u043e\u043b\u0438 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u0439, \u0440\u0430\u0441\u043a\u0440\u044b\u0432\u0430\u044e\u0442 \u0437\u0430\u0433\u043e\u0432\u043e\u0440\u044b, \u0441\u0442\u0430\u043b\u043a\u0438\u0432\u0430\u044e\u0442\u0441\u044f \u0441 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u0443\u0436\u0430\u0441\u0430\u043c\u0438 \u0438 \u0431\u043e\u0440\u044e\u0442\u0441\u044f \u0441 \u0445\u0440\u0443\u043f\u043a\u043e\u0441\u0442\u044c\u044e \u0441\u0432\u043e\u0435\u0433\u043e \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u0430. \u042d\u0442\u043e \u0438\u0433\u0440\u0430, \u0433\u0434\u0435 \u0432\u044b\u0436\u0438\u0432\u0430\u043d\u0438\u0435 \u043c\u043e\u0436\u0435\u0442 \u043e\u0437\u043d\u0430\u0447\u0430\u0442\u044c \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0432\u044b\u0431\u043e\u0440 \u0431\u0435\u0437 \u0442\u0435\u043b\u0435\u0441\u043d\u044b\u0445 \u043f\u043e\u0432\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0439, \u0430 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u0437\u0434\u0440\u0430\u0432\u043e\u0433\u043e \u0441\u043c\u044b\u0441\u043b\u0430.\n\n"},
