gq8(){return"\u0420\u0430\u0441\u043a\u0440\u044b\u0432\u0430\u0439\u0442\u0435 \u0443\u043b\u0438\u043a\u0438, \u0440\u0430\u0441\u0448\u0438\u0444\u0440\u043e\u0432\u044b\u0432\u0430\u0439\u0442\u0435 \u0437\u0430\u0433\u0430\u0434\u043e\u0447\u043d\u044b\u0435 \u043f\u043e\u0441\u043b\u0430\u043d\u0438\u044f \u0438 \u0441\u043e\u0435\u0434\u0438\u043d\u044f\u0439\u0442\u0435 \u0442\u043e\u0447\u043a\u0438, \u0447\u0442\u043e\u0431\u044b \u0440\u0430\u0441\u043a\u0440\u044b\u0442\u044c \u0443\u0436\u0430\u0441\u0430\u044e\u0449\u0443\u044e \u043f\u0440\u0430\u0432\u0434\u0443.\n\n"},
gq9(){return"\u0421\u0442\u043e\u043b\u043a\u043d\u0438\u0442\u0435\u0441\u044c \u0441 \u041a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u0423\u0436\u0430\u0441\u0430\u043c\u0438"},
gqa(){return"\u0421\u0442\u043e\u043b\u043a\u043d\u0438\u0442\u0435\u0441\u044c \u0441 \u043f\u043e\u0442\u0443\u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0438\u043c\u0438 \u0441\u0443\u0449\u043d\u043e\u0441\u0442\u044f\u043c\u0438, \u0432\u044b\u0445\u043e\u0434\u044f\u0449\u0438\u043c\u0438 \u0437\u0430 \u043f\u0440\u0435\u0434\u0435\u043b\u044b \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u044f. \u042d\u0442\u0438 \u0443\u0436\u0430\u0441\u044b \u043c\u043e\u0433\u0443\u0442 \u0438\u0441\u043a\u0430\u0436\u0430\u0442\u044c \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c, \u043f\u0440\u043e\u0432\u0435\u0440\u044f\u044f \u043f\u0440\u0435\u0434\u0435\u043b\u044b \u0437\u0434\u0440\u0430\u0432\u043e\u043c\u044b\u0441\u043b\u0438\u044f \u0432\u0430\u0448\u0435\u0433\u043e \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044f.\n\n"},
gqb(){return"\u0411\u043e\u0439 \u043d\u0435 \u0432\u0441\u0435\u0433\u0434\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c. \u0418\u043d\u043e\u0433\u0434\u0430 \u0443\u0431\u0435\u0433\u0430\u043d\u0438\u0435 \u0438\u043b\u0438 \u0441\u043a\u0440\u044b\u0442\u0438\u0435 \u2014 \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u043f\u043e\u0441\u043e\u0431 \u0432\u044b\u0436\u0438\u0442\u044c.\n\n"},
