gqe(){return"\u041f\u043e \u043c\u0435\u0440\u0435 \u0443\u0445\u0443\u0434\u0448\u0435\u043d\u0438\u044f \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u0430, \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0438 \u043c\u043e\u0433\u0443\u0442 \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0441\u0442\u0438 \u0444\u043e\u0431\u0438\u0438, \u0433\u0430\u043b\u043b\u044e\u0446\u0438\u043d\u0430\u0446\u0438\u0438 \u0438\u043b\u0438 \u0434\u0430\u0436\u0435 \u043f\u043e\u0433\u0440\u0443\u0437\u0438\u0442\u044c\u0441\u044f \u0432 \u0431\u0435\u0437\u0443\u043c\u0438\u0435.\n\n"},
