gqg(){return"\u0418\u0433\u0440\u0430 \u043f\u0440\u043e\u043f\u0438\u0442\u0430\u043d\u0430 \u043b\u044e\u0431\u043a\u0440\u0430\u0444\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u043b\u043e\u0440\u043e\u0439, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0441\u0443\u0449\u043d\u043e\u0441\u0442\u0438, \u0442\u0430\u043a\u0438\u0435 \u043a\u0430\u043a \u041a\u0442\u0443\u043b\u0445\u0443, \u041d\u044c\u044f\u0440\u043b\u0430\u0442\u0445\u043e\u0442\u0435\u043f \u0438 \u0410\u0437\u0430\u0442\u043e\u0442. \u042d\u0442\u0438 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0430 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\u0442 \u0432\u043d\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u044f \u0438 \u0447\u0430\u0441\u0442\u043e \u0432\u043b\u0438\u044f\u044e\u0442 \u043d\u0430 \u043e\u0431\u0449\u0438\u0439 \u0441\u044e\u0436\u0435\u0442.\n\n"},
